description:
Title: Yager
Developer: YAGER Development
Publisher: THQ
Genre: Flight shooter
Published: 2003
Description: The player in the role of air ace Magnus Tide, who after crashing his plane, losing his job and being dumped by his girlfriend, feels like his life can't get any worse. Fortunately, Magnus managed to get himself a new ship and a new job as a freelancer for his former employer, Proteus. Unfortunately for Magnus, his new job couldn't have come at a worse time, as the world is on the verge of full scale war.
Metacritic: http://www.metacritic.com/games/platforms/pc/aerialstriketheyagermissions

Installation:
1) Mount or burn game image;
2) Install the game (full installation);
3) Apply the patch from Patch dir on disc;
4) Copy cracked executables from Crack dir on disc to game install dir, overwriting the original files;
5) Play the game without the DVD;
6) Support the producer.
